  return (
    <AngleSection height="90vh" color="original.primary" {...props}>
      <Flex
        h="50%"
        mt="5vh"
        pos="relative"
        flexDir="column"
        alignItems="center"
        justifyContent="center"
      >
        <Logo.Typographic width={400} />
        Test
      </Flex>
    </AngleSection>
  );
};
